    F_D = F_d_grid(k);
    Uref(:,k) = [T_S; T_E; T_W; T_F; F_D];
    CalculateStateGradients
    A(:,:,k) = cat(1, [DQSPDQS; DQSPDQE; DQSPDQW; DQSPDQF; DQSPDQSP; DQSPDQEP; DQSPDQWP; DQSPDQFP]', [DQEPDQS; DQEPDQE; DQEPDQW; DQEPDQF; DQEPDQSP; DQEPDQEP; DQEPDQWP; DQEPDQFP]', [DQWPDQS; DQWPDQE; DQWPDQW; DQWPDQF; DQWPDQSP; DQWPDQEP; DQWPDQWP; DQWPDQFP]', [DQFPDQS; DQFPDQE; DQFPDQW; DQFPDQF; DQFPDQSP; DQFPDQEP; DQFPDQWP; DQFPDQFP]', [DQSPPDQS; DQSPPDQE; DQSPPDQW; DQSPPDQF; DQSPPDQSP; DQSPPDQEP; DQSPPDQWP; DQSPPDQFP]', [DQEPPDQS; DQEPPDQE; DQEPPDQW; DQEPPDQF; DQEPPDQSP; DQEPPDQEP; DQEPPDQWP; DQEPPDQFP]', [DQWPPDQS; DQWPPDQE; DQWPPDQW; DQWPPDQF; DQWPPDQSP; DQWPPDQEP; DQWPPDQWP; DQWPPDQFP]', [DQFPPDQS; DQFPPDQE; DQFPPDQW; DQFPPDQF; DQFPPDQSP; DQFPPDQEP; DQFPPDQWP; DQFPPDQFP]');
