end

% Calculate feedback policy to stabilze forward simulation with RK4
K = zeros(m,n,knots);
for k = 1:knots
    [K(:,:,k),~,~] = lqrd(A(:,:,k),B(:,:,k),Q,R,dt); % solves for a digital implementation
end

% Forward Rollout
U = zeros(m, knots-1);
Z = zeros(n,knots);
Z(:,1) = [qs_grid(1); qe_grid(1); qw_grid(1); qf_grid(1); qsp_grid(1); qep_grid(1); qwp_grid(1); qfp_grid(1)];
U(:,1) = [T_s_grid(1);  T_e_grid(1);  T_w_grid(1);  T_f_grid(1);  F_d_grid(1)];
for k = 1:knots-1
    U(:,k) = Uref(:,k) - K(:,:,k)*(Z(:,k) - Zref(:,k));
    Z(:,k+1) = rk4(Z(:,k), U(:,k), dt);
end

