%% RK4 Forward Simulation Functions
function [zplus1] = rk4(z,u,dt)
    k1 = dt.*dynamics(z,u);
    k2 = dt*dynamics(z + k1/2,u);
    k3 = dt*dynamics(z + k2/2,u);
    k4 = dt*dynamics(z + k3,u);
    zplus1 = z + (1/6)*(k1 + 2*k2 + 2*k3 + k4);
end

